db.patients.aggregate([
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $unwind: "$ENCOUNTERS.MEDICATIONS"
    },
    {
        $match: {
            "ENCOUNTERS.MEDICATIONS.CODE": "NDA020800"
        }
    },
    {
        $project: {
            _id: 0,
            ENCOUNTERS: 1,
            ENCOUNTERS_MEDICATIONS: "$ENCOUNTERS.MEDICATIONS"
        }
    },
    {
        $group: {
            _id: {
                ENCOUNTER_ID: "$ENCOUNTERS.ENCOUNTER_ID",
                MEDICATION_CODE: "$ENCOUNTERS_MEDICATIONS.CODE"
            },
            TOTAL: {
                $sum: 1
            },
            SUCCESS: {
                $sum: {
                    $cond: [
                        {
                            $eq: [
                                "$ENCOUNTERS_MEDICATIONS.REASON_CODE", 1
                            ]
                        },
                        1,
                        0
                    ]
                }
            }
        }
    },
    {
        $project: {
            _id: 0,
            SUCCESS_RATE: {
                $divide: [
                    "$SUCCESS",
                    "$TOTAL"
                ]
            },
            MEDICATION_CODE: "$_id.MEDICATION_CODE"
        }
    }
]);

db.organizations.aggregate([
    {
        $match: {
            "_id": "844a8cb2-4164-35b2-88b8-dffa2889a738"
        }
    },
    {
        $project: {
            _id: 0,
            NAME: 1
        }
    },
    {
        $lookup: {
            from: "patients",
            localField: "NAME",
            foreignField: "ADDRESS",
            as: "patients"
        }
    },
    {
        $unwind: "$patients"
    },
    {
        $project: {
            _id: 0,
            PATIENT_ID: "$patients.PATIENT_ID",
            FIRST: "$patients.FIRST",
            LAST: "$patients.LAST"
        }
    }
]);

db.patients.aggregate([
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $unwind: "$ENCOUNTERS.MEDICATIONS"
    },
    {
        $unwind: "$ENCOUNTERS.MEDICATIONS.PAYER_REF"
    },
    {
        $lookup: {
            from: "payers",
            localField: "ENCOUNTERS.MEDICATIONS.PAYER_REF",
            foreignField: "PAYER_ID",
            as: "payer"
        }
    },
    {
        $unwind: "$payer"
    },
    {
        $match: {
            "payer.NAME": { $regex: 'Alendronic acid 10 MG Oral Tablet', $options: 'i' }
        }
    },
    {
        $project: {
            _id: 0,
            PAYER_NAME: "$payer.NAME"
        }
    }
])

db.patients.aggregate([
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $unwind: "$ENCOUNTERS.MEDICATIONS"
    },
    {
        $unwind: "$ENCOUNTERS.MEDICATIONS.ALLERGIES"
    },
    {
        $match: {
            "ENCOUNTERS.MEDICATIONS.ALLERGIES.DESCRIPTION": "Acetaminophen 300 MG / Hydrocodone Bitartrate 5 MG Oral Tablet"
        }
    },
    {
        $unwind: "$CLAIMS"
    },
    {
        $unwind: "$CLAIMS.CLAIM_TRANSACTIONS"
    },
    {
        $group: {
            _id: {
                PAYER_REF: "$CLAIMS.CLAIM_TRANSACTIONS.PAYER_INSURANCE_REF"
            }
        }
    },
    {
        $project: {
            _id: 0,
            PAYER_REF: "$_id.PAYER_REF"
        }
    }
])

db.patients.aggregate([
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $lookup: {
            from: "payers",
            localField: "HEALTHCARE_COVERAGE",
            foreignField: "_id",
            as: "payer"
        }
    },
    {
        $unwind: "$payer"
    },
    {
        $match: {
            "payer.PAYER_ID": "0133f751-9229-3cfd-815f-b6d4979bdd6a",
            "ENCOUNTERS.PAYER_REF": {
                $not: {
                    $eq: "$payer._id"
                }
            }
        }
    },
    {
        $group: {
            _id: null,
            count: {
                $sum: 1
            }
        }
    },
    {
        $project: {
            _id: 0,
            count: 1
        }
    }
]);
